<p><span class="file">src/components/mediaObject/cdrMediaObject.vue<span></p>
<p>Cedar 2 component for media object</p>
<p>The Media Object allows you to group small amounts of like content is a small amount of markup. The examples below show some of the may visual displays available to this component.</p>
<p><span class="modifiers">Modifiers</span></p>
