<p>right: Media figure displays to the right of the Media body</p>
<p>bottom: Media figure displays below the Media body</p>
<p>center: Can be stacked with other alignment modifiers and will center the Media figure.</p>
<p>overlay: Media Body overlays the Media Frame</p>
<p>stretch: The Media Frame extends 16px left and right from the parent container. This is intended to be used with the top or bottom modifier.</p>
<p>block: The Media Frame extends 16px left and right from the parent container. And an additional 16px left and right value wraps the media object. This is intended to be used with the top or bottom modifier.</p>
